#DrellYanAnalyzer output files
DrellYanAnalyzerOutputFiles=( "${DrellYanAnalyzerOutputFilePrefix}DrellYanAnalysis_SingleMu_Run2012A_${version}.root" "${DrellYanAnalyzerOutputFilePrefix}DrellYanAnalysis_SingleMu_Run2012B_${version}.root" "${DrellYanAnalyzerOutputFilePrefix}DrellYanAnalysis_SingleMu_Run2012C_${version}.root" "${DrellYanAnalyzerOutputFilePrefix}DrellYanAnalysis_SingleMu_Run2012D_${version}.root" )

#samples
samples=( "SingleMu_Run2012A" "SingleMu_Run2012B" "SingleMu_Run2012C" "SingleMu_Run2012D" )

####GENERATION LOOP####

#change to working directory
mkdir -p $dir
cd $dir

#loop over number of samples
for i in `seq $iBeg $iEnd`
  do

  #generate cfg file
  sed -e "s%FILES%${inputFileBlocks[${i}]}%" -e "s%OUTFILE%${DrellYanAnalyzerOutputFiles[${i}]}%" -e "s%PUSCENARIO%S10%" -e "s%MCFLAG%False%" ../${templateCfg} > drellyananalyzer_${samples[${i}]}_cfg.py

  #generate job submission script for LSF
  cat <<EOF > drellyananalyzer_${samples[${i}]}_cfg.sh
#!/bin/bash

jobDir="`pwd`"
fileNamePrefix="drellyananalyzer_${samples[${i}]}"

cd \$jobDir
eval \`scramv1 runtime -sh\`
cd -
cp \$jobDir/\${fileNamePrefix}_cfg.py .
cmsRun \${fileNamePrefix}_cfg.py
cmsStage -f ${DrellYanAnalyzerOutputFiles[${i}]} /store/user/`whoami`/
rm ${DrellYanAnalyzerOutputFiles[${i}]} 

exit 0
EOF
  chmod a+x drellyananalyzer_${samples[${i}]}_cfg.sh
done

#generate run cfg that runs all files in the directory
cat <<EOF > runDataDrellYanAnalyzerCfgs.sh
#!/bin/bash

for file in \`ls -alh *SingleMu*.py | awk '{ print \$9 }'\`
  do
  outFile=\`echo \$file | sed -e "s%\.py%.txt%"\`
  cmsRun \$file > \$outFile
done

exit 0
EOF
chmod a+x runDataDrellYanAnalyzerCfgs.sh

#generate script that submits all jobs to LSF
cat <<EOF > submitDataDrellYanAnalyzerJobs.sh
#!/bin/bash

for file in \`ls -alh drellyananalyzer*SingleMu*.sh | awk '{ print \$9 }'\`
  do
  jobName=\`echo \$file | sed -e "s%\(.*\)\.sh%\1%"\`
  bsub -q 8nh -J \$jobName < \$file
done

exit 0
EOF
chmod a+x submitDataDrellYanAnalyzerJobs.sh

#generate script that copies all files locally from EOS
cat <<EOF > copyDrellYanEnrichedDataFromEOS.sh
#!/bin/bash

eval \`scramv1 runtime -sh\`
for sample in "A" "B" "C" "D"
  do
  cmsStage -f /store/user/`whoami`/DrellYanAnalysis_SingleMu_Run2012\${sample}_${version}.root /data1/`whoami`/data/analysis/
